import React from 'react';
import { Link } from 'react-router-dom';

import Logo from '../assets/110pm_EMBL-300X360.gif';

const Navbar = () => {
  return (
    <div className='navbar'>
      <div className='left_side'>
        <img src={Logo}></img>
      </div>
      <div className='right_side'>
        <Link to='/'> Home </Link>
        <Link to='/'> ΠΡΟΣΩΠΙΚΟ </Link>
        <Link to='/'> ΟΙΚΗΜΑΤΑ </Link>
        <Link to='/'> ΑΙΤΗΣΕΙΣ </Link>
      </div>
    </div>
  )
}

export default Navbar;
